import React from "react";
import carServices from "../services/carServices";
import Car from "../Pages/car.js";
import {BrowserRouter, Route, Routes, Link} from 'react-router-dom';
import {useEffect, useState} from 'react';


class CarComponent extends React.Component {

        constructor(props) {
            super(props)
            this.state = {
                cars:[]
            }
        }

        componentDidMount() {
            carServices.getCars().then((response) => {
                this.setState({cars: response.data})
            });
        }

        render (){
            return (
                <div>
                    <h1>AutoShow.by</h1>
                    <div class="cars">
                    {
                                this.state.cars.map(
                                    car =>
                                    <div class="car" key = {car.id}>
                                        <div class="car-img">
                                            <p><img src ={car.imageCar}></img></p>
                                        </div>
                                        <div class="car-info-all">
                                            <div class="car-info">
                                                <h4><Link to={`/car/${car.id}`}> {car.carBrand} {car.model}</Link></h4>
                                                <p>Год выпуска: {car.yearRelease}</p>
                                            </div>
                                            <div class="prise-car">
                                                <p>Цена: {car.prise}</p>
                                            </div>
                                        </div>
                                    </div>
                                )
                            }
                    </div>
                </div>
                
            )
        }
}

export default CarComponent
